import React, { Component } from 'react';
import ButFiles from 'src/Components/ButFiles';
class FilesNav extends Component {
    render() {
        return (            
            <div class="d-grid gap-2 mt-3">
                
                <ButFiles></ButFiles>
            </div>
        );
    }
}

export default FilesNav;
